import React from 'react';
import Footer from "../components/Footer";
import NavBar from "../components/NavBar";

const AboutPage = () => {
    return (
        <div className="container">
            <NavBar/>
                <h2>About Page</h2>
            <Footer/>
        </div>
    );
};

export default AboutPage;
